package letcode.code300;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

public class Question242 {

    public boolean isAnagram(String s, String t) {

        if (s.length() != t.length()) {
            return false;
        }

        Map<Character, Integer> maps = new HashMap<>();
        Map<Character, Integer> mapt = new HashMap<>();
        for (int i = 0; i < s.length(); ++i) {
            char c = s.charAt(i);
            Integer integer = maps.get(c);
            if (integer == null) {
                maps.put(c, 1);
            } else {
                integer ++;
                maps.put(c, integer);
            }
        }

        for (int i = 0; i < t.length(); ++i) {
            char c = t.charAt(i);
            Integer integer = mapt.get(c);
            if (integer == null) {
                mapt.put(c, 1);
            } else {
                integer ++;
                mapt.put(c, integer);
            }
        }

        Iterator<Character> iterator = maps.keySet().iterator();
        while (iterator.hasNext()) {
            Character c = iterator.next();
            Integer scnt = maps.get(c);
            Integer tcnt = mapt.get(c);
            if (tcnt == null || scnt == null) {
                return false;
            }
            if (scnt.intValue() != tcnt.intValue()) {
                return false;
            }
        }
        return true;
    }


    public static void main(String[] args) {

        String s = "";
        String t = "";
        Question242 question242 = new Question242();
        System.out.println(question242.isAnagram(s, t));
    }
}
